import React, { Component } from "react";
import "./App.css";
import Button from "@material-ui/core/Button";
import Checkbox from "@material-ui/core/Checkbox";

class PantoneGallery extends Component {
  render() {
    console.log("Gallery props", this.props);
    const { pantones } = this.props;
    return (
      <div>
        {pantones.map((pantone, k) => {
          return (
            <div key={k} className="pantone-item">
              <div className="pantone-color">&nbsp;</div>
              <div className="pantone-title">{pantone.Item}</div>
              <div className="pantone-title">
                <Button href={pantone.Link}>We like this one</Button>
              </div>
              <div className="pantone-title">
                <Checkbox /> purchased
              </div>
            </div>
          );
        })}
      </div>
    );
  }
}

export default PantoneGallery;
